import React, { useState } from 'react';
import './AddExercise.css';
import { supabase } from ''; 

const AddExercise = ({ supabase, session}) => {
  const userId = session.user.id;
  const [exerciseData, setExerciseData] = useState({
    name: '',
    description: '',
    calories_per_unit_duration: 0,
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setExerciseData({
      ...exerciseData,
      [name]: value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const { data, error } = await supabase.from('cardio_exercise').insert([
        {
          name: exerciseData.name,
          description: exerciseData.description,
          calories_per_unit_duration: exerciseData.calories_per_unit_duration,
        },
      ]);

      if (error) {
        console.error('Error adding cardio exercise:', error);
      } else {
        console.log('Cardio exercise added:', data);
        // You can add any success message or navigation logic here
      }
    } catch (error) {
      console.error('Error adding cardio exercise:', error);
    }
  };

  return (
    <div className="page">
      <div className="container ctn-exercise">
        <h1>Add A Cardio Exercise</h1>
        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <label>Name:</label>
            <input
              type="text"
              name="name"
              value={exerciseData.name}
              onChange={handleChange}
              required
            />
          </div>
          <div className="form-group">
            <label>Description:</label>
            <textarea
              name="description"
              value={exerciseData.description}
              onChange={handleChange}
              required
            ></textarea>
          </div>
          <div className="form-group">
            <label>Calories per Unit Duration:</label>
            <input
              type="number"
              name="calories_per_unit_duration"
              value={exerciseData.calories_per_unit_duration}
              onChange={handleChange}
              required
            />
          </div>
          <button type="submit">Add Exercise</button>
        </form>
      </div>
    </div>
  );
};

export default AddExercise;
